import React from "react";

import { useNavigate } from "react-router-dom"

const Error=()=>{
    const navigate = useNavigate()
    return (
        <>

            <h1>404</h1>
            <p>Voce parece meio perdido</p>
            <a onClick={()=>navigate("/")}>Home</a>

        </>

    )
}
export default Error
